pageFunction:
function pageFunction(context) {
    // called on every page the crawler visits, use it to extract data from it
    var $ = context.jQuery;
    var results = [];
    $(".media-body").each(function() {
       results.push({
           title: $(this).find(".media-heading.lead").text().trim(),
           link: $(this).find("a").attr("href")//instead of getting title text, we are getting the link, hence attr("href")

       });
    });
    return results;
    //for the pseudo-url, we are using p=[\d+] to get more than one page for results
    //clickable elements will allow you to click on a link. 
}

interceptRequest:
function interceptRequest(context, newRequest) {
    // called whenever the crawler finds a link to a new page,
    // use it to override default behavior
    return newRequest;
}
